function Tollbar() {
  return (
    <div class="topnav">
      <div>
        <a href="#news">Home</a>
        <a href="#contact">About</a>
      </div>
      <div>
        <a href="#about">Login</a>
      </div>
    </div>
  );
}

export default Toolbar;
